import './Receipt.css';

function Receipt() {
    return (
        <div className='coke'>
            <h1>결제가 완료 되었습니다.<br/>영수증을<br/>출력하시겠습니까?</h1>
            <button className='react'>예</button><br/>
            <button className='react'>아니오</button><br/>
            <button className='react'>주문 번호 x번</button>

        </div>
    );
}

export default Receipt;
